contract ShiroToken is BEP20('Extended SHIRO', 'xSHR') {
    uint256 private _cap = 101051200e18; //101,051,200

    function cap() public view returns (uint256) {
        return _cap;
    }

    // @notice Creates `_amount` token to `_to`. Must only be called by the owner (MasterChef).
    function mint(address _to, uint256 _amount) external onlyOwner returns (bool) {
        require(totalSupply().add(_amount) <= cap(), "cap exceeded");
        _mint(_to, _amount);
        return true;
    }

    function mint(uint256 _amount) public onlyOwner override returns (bool) {
        require(totalSupply().add(_amount) <= cap(), "cap exceeded");
        _mint(_msgSender(), _amount);
        return true;
    }
}

